import React from "react";
import friend from './friends-4187953_1280.webp'
import './index.css'

const Friend = () => {
  return (
    <>
      <div className="container col my-5">
        <div className="container mx-2 mt-5">
          <h2 className="text-center text-success">Hey ! My Dear Friend</h2>
          <p className="text-dark text-center my-4" style={{fontSize:" 22px"}}>
            I just want to say thanks you for being a part of our journey ,
            Helping out me for Everytime
          </p>
        </div>
      </div>

      <img src={friend} alt="friend" className="img" style={{width:"30%",marginLeft:"30%",minWidth:"100px"}} />
      <h1 className="text-center text-primary my-5">Thank You Buddy</h1>
      
    </>
  );
};

export default Friend;
